import React from "react";
import './navbar.css';

export default function Navbar(){
    return (
        <div className="navbar">
            <a href="https://open.spotify.com/" target="_blank"><img src="https://img.freepik.com/premium-vector/headphone-icon-template-with-transparent-background_929446-74.jpg?w=1800"></img></a>
            <div className="center">
                <h1>Welcome to SpotMV!</h1>
            </div>

        </div>
    )
}
